from typing import List

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        mem = []
        result_p = []
        s_len = len(s)
        i = 0
        while i < s_len:
            for j in range(s_len):
                if i > j:
                    continue
                if s[j] in mem:
                    result_p.append((i, j))
                    mem = []
                    for k in range(i, j): # 起始位置前移，前面位置可抛弃
                        if s[j] == s[k]:
                            i = k + 1
                    break
                mem.append(s[j])
            else:
                result_p.append((i, j+1))
                i = s_len # 结束
                

        result_max = 0

        print(result_p)

        for r in result_p:
            result_max = max(result_max, r[1] - r[0])

        return result_max

